package main

import (
	"bytes"
	"encoding/base64"
	"encoding/json"
	"errors"
	"fmt"
	"github.com/go-resty/resty/v2"
	"github.com/gogf/gf/frame/g"
	uuid "github.com/satori/go.uuid"
	"strings"
	"sync"
	"time"
)

type ImageRes struct {
	ErrorCode int
	Message   string
	Data      map[string]string
}

const (
	FileKeyField  = "fileKey"
	RFileKeyField = "FileKey"
)

type FileCateString string

const (
	FileCateHeadPicture FileCateString = "head"
	FileCateFace        FileCateString = "face"
	FileCateCaptureCar  FileCateString = "test"
	FileCateCaptureFace FileCateString = "capture_face"
)

var wg sync.WaitGroup

func main() {
	imageBaseURLEncoding := ""
	buf, _ := base64.StdEncoding.DecodeString(imageBaseURLEncoding)
	wg.Add(10000)
	for i := 1; i <= 10000; i++ {
		fileKey := DynamicFileName(FileCateCaptureCar)
		//fileKey := "test/test.png"
		time.Sleep(time.Millisecond * 5)
		//保存图片
		go saveImage("http://172.20.72.56:56630/fapi/FileServer/UploadImage", UUIDString(), &buf, map[string]string{
			FileKeyField: fileKey,
		})
		fmt.Println("++++++++++++i+++++++++", i)
	}
	wg.Wait()
	fmt.Println("+++++success+++++")
}

// DynamicFileName 动态根据日期生成文件名
func DynamicFileName(cate FileCateString) string {
	return string(cate) + "/" + time.Now().Format("2006/0102/1504/05") + "_" + UUIDString()
}

// GenerateFileNameByDate 根据日期生成文件名
func GenerateFileNameByDate(prefix string) string {
	return prefix + "/" + time.Now().Format("2006/0102/1504/05") + "_" + UUIDString()
}

// UUIDString 生成uuid string
func UUIDString() string {
	return strings.Replace(uuid.NewV4().String(), "-", "", -1)
}

// saveImage 通过接口保存图片
func saveImage(url string, fileName string, imageBytes *[]byte, formData map[string]string) (fileKey string, err error) {
	fmt.Println("+++++goroutine start++++++++")
	var (
		resp *resty.Response
	)
	client := resty.New()
	resp, err = client.R().
		SetFileReader("file", fileName, bytes.NewReader(*imageBytes)).
		SetFormData(formData).
		Post(url)
	if err != nil {
		fmt.Println("+++++err-curl++++++++", err)
		return
	}
	g.Log().Debug("++++++++++saveImage formData+++++++", formData, "+++++Body+++", string(resp.Body()), "+++++err+++", err)

	res := &ImageRes{}
	err = json.Unmarshal(resp.Body(), res)
	if err != nil {
		return
	}
	if res.ErrorCode != 0 {
		err = errors.New(res.Message)
		fmt.Println("+++++err-ErrorCode++++++++", res.ErrorCode)
		return
	}
	if _, ok := res.Data[RFileKeyField]; !ok {
		fmt.Println("+++++err-Data++++++++", res)
		return
	}
	wg.Done()
	return res.Data[RFileKeyField], nil
}
